BEGIN;
INSERT INTO `go_article` VALUES ('1', '5', 'author', '了解OneShop', '', '', 'a:2:{i:0;s:33:\"photo/20130902/41484375056924.jpg\";i:1;s:33:\"photo/20130902/26578125056924.jpg\";}', '了解OneShop|OneShop|OneShop|OneShop介绍|', '', '<p>	</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p class=\"textindent\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">OneShop是一种新型的网购模式，只需1元就有可能买到一件商品。OneShop网把一件商品平分成若干“等份”出售，每份1元，当一件商品所有“等份”售出后抽出一名幸运者，该幸运者即可获得此商品。</p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal; \">规则：</h3><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">1、每件商品参考市场价平分成相应“等份”，每份1元，1份对应1个购买码。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">2、同一件商品可以购买多次或一次购买多份。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">3、当一件商品所有“等份”全部售出后计算出“幸运OneShop码”，拥有“幸运购买码”者即可获得此商品。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">4、幸运OneShop码计算方式：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 36px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: -1em; \">1）取该商品最后购买时间前网站所有商品100条购买时间记录（限时揭晓商品取截止时间前网站所有商品100条购买时间记录）。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: 1.6em; \">2）时间按时、分、秒、毫秒依次排列组成一组数值。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; height: 10px; \">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: 1.6em; \">3）将这100组数值之和除以商品总需参与人次后取余数，余数加上10,000,001即为“幸运购买码”。</p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal; \">流程：</h3><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \"><strong style=\"margin: 0px; padding: 0px; \">1、挑选商品</strong></p><p style=\"margin-bottom: 15px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">分类浏览或直接搜索商品，点击“立即1元购买”。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \"><strong style=\"margin: 0px; padding: 0px; \">2、支付1元</strong></p><p style=\"margin-bottom: 10px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">通过在线支付平台，支付1元即购买1人次，获得1个“购买码”。同一件商品可购买多次或一次购买多份，购买的“购买码”越多，获得商品的几率越大。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \"><strong style=\"margin: 0px; padding: 0px; \">3、揭晓获得者</strong></p><p style=\"margin-bottom: 15px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">当一件商品达到总参与人次，抽出1名商品获得者，1元OneShop网会通过手机短信或邮件通知您领取商品。</p><h3 style=\"margin: 0px; padding: 0px 0px 0px 22px; font-size: 14px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; line-height: 30px; white-space: normal; \">注：</h3><p style=\"margin-bottom: 10px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: 1.6em; \">1）商品揭晓后您可登录&quot;我的1元购买&quot;查询详情，未获得商品的用户不会收到短信或邮件通知；</p><p style=\"margin-bottom: 10px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: 1.6em; \">2）商品揭晓后，请及时登录&quot;我的1元购买&quot;完善个人资料，以便我们能够准确无误地为您配送商品。</p><p style=\"margin-bottom: 10px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; text-indent: 1.6em; \">3）所有已揭晓商品均不给予退款</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \"><strong style=\"margin: 0px; padding: 0px; \">4、晒单分享</strong><br style=\"margin: 0px; padding: 0px; \"/></p><p style=\"margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">晒出您收到的商品实物图片甚至您的靓照，说出您的OneShop心得，让大家一起分享您的快乐。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; line-height: 30px; white-space: normal; \">在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得1000福分奖励。在您成功晒单后，您的晒单会出现在网站&quot;晒单分享&quot;区，与大家分享喜悦。</p><p><br/></p>', '198', '1', '1375862513'), ('2', '2', 'author', '常见问题', '', '', 'a:0:{}', 'OneShop，OneShop币，一元购物', '', '<p>	</p><p><br/></p><p><br/></p><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">&nbsp;</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\"><strong>参加方式：</strong></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">1、充值获得OneShop币，然后选择喜欢的商品开始OneShop；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">2、点击一个感兴趣的商品，选择要参与的人次并支付，直接充值并参与夺宝。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\"><strong>1元夺宝，就是这么简单！</strong></p><ol class=\"m-helpcenter-list list-paddingleft-2\" style=\"list-style-type: none;\"><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">2、OneShop是怎么计算幸运号码的？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">1）商品的最后一个号码分配完毕后，将公示截止该时间点本站全部商品的最后50个参与时间；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">2）将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">3）（数值A+数值B）除以该商品总需人次得到的余数<span data-func=\"remainder\" class=\"ico ico-questionMark\" style=\"display: inline-block; vertical-align: middle; overflow: hidden; width: 16px; height: 16px; margin-top: -4px; background: url(&quot;../img/7bb09c282377f08a16e399b734b17bf59144c1bc.png&quot;) -60px -510px no-repeat;\"></span>&nbsp;+ 原始数&nbsp;10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该商品。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">3、怎样查看是否成为幸运用户？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">个人中心有您的夺宝记录，点击对应的记录，即可知道该期夺宝的获得者；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">如果您成为幸运用户，将会有邮件等方式的通知。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">4、如何领取幸运商品？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">在您成为幸运用户后会收到电子邮件通知。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">收到通知后，请到个人中心填写真实的收货地址，完善或确认您的个人信息，以便我们为您派发获得的商品。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">5、商品是正品吗？怎么保证？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">OneShop所有商品均由本公司采购及发货，100%正品，可享受厂家所提供的全国联保服务。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">6、我收到的商品可以换货或者退货吗？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">非质量问题，不在三包范围内，不给予退换货</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">请尽量亲自签收并当面拆箱验货，如果发现运输途中造成了商品的损坏，请不要签收，可以拒签退回。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">7、如果一件商品很久都没达到总需人次怎么办？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">若某件商品的夺宝号码从开始分配之日起90天未分配完毕，则本公司有权取消该件商品的夺宝活动，并向用户退还OneShop币，所退还夺宝币将在3个工作日内退还至用户账户中。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">8、参与<span style=\"color: rgb(59, 59, 59); font-weight: bold;\">OneShop</span>需要注意什么？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">为了确保在您成为幸运用户后第一时间收到通知，请务必正确填写真实有效的联系电话和收货地址。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">9、网上支付未及时到帐怎么办？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">网上支付未及时到帐可能有以下几个原因造成：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">第一，由于网速或者支付接口等问题，支付数据没有及时传送到支付系统造成的；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">第二，网速过慢，数据传输超时使银行后台支付信息不能成功对接，导致银行交易成功而支付后台显示失败；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">第三，如果使用某些防火墙软件，有时会屏蔽银行接口的弹出窗口。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">如果支付过程问题遇到问题，请与我们联系。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">10、什么是夺宝币？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\"><span style=\"color: rgb(59, 59, 59); font-weight: bold;\">OneShop币</span>是<span style=\"color: rgb(59, 59, 59); font-weight: bold;\">OneShop</span>的代币，用户每充值1元，即可获得1个OneShop币；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">1个夺宝币可以直接购买1个夺宝号码。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">11、如何进行OneShop币充值？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">个人中心可以找到入口进行充值；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">需要注意的是，充值之后获得的是夺宝币，可以直接用于参与夺宝。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">12、OneShop币是否可以提现？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">很抱歉，OneShop币无法提现。</p></li><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">13、您付款遇到问题了？看看是不是由于下面的原因。</p></li><ol class=\"custom_num list-paddingleft-1\" style=\"list-style-type: none;\"><li class=\"list-num-1-1 list-num-paddingleft-1\"><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">问题一：支付平台已经扣款，但OneShop币余额没有增加？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">答：请您不用担心，如果是因为银行单边账等原因造成的上述问题，已付款项将会在5-7个工作日内原路退回到您的银行账户；如果是因为银行网络延迟等原因造成的上述问题，则已付款项将会在会在5-7个工作日内以余额形式充值到您的OneShop币账户。</p></li><li class=\"list-num-1-2 list-num-paddingleft-1\"><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\"><span style=\"color: rgb(59, 59, 59); font-weight: bold;\">问题二</span>：支付平台重复多次付款了该怎么办？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">答：由于支付平台没有即时传输数据给OneShop，造成您在支付平台被重复扣款。不过请放心，OneShop将在和支付平台对账确认您的付款后，将重复支付款项原路退回到您的支付平台账户。</p></li></ol><li><p class=\"m-helpcenter-list-q\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px; color: rgb(59, 59, 59); font-weight: bold;\">14、建议反馈</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px 0px 0px 25px;\">如果您有任何意见或建议，请点击这里与我们联系，谢谢！</p></li></ol><p><br/></p>', '100', '3', '1466568180'), ('3', '5', 'author', '服务协议', '', '', 'a:0:{}', '', '', '<p>	</p><p style=\"margin-bottom:10px;text-align:center;line-height:26px;background:white\"><strong><span style=\"font-size: 20px;font-family: &#39;Microsoft YaHei&#39;\"><br/>OneShop</span></strong><strong><span style=\"font-size: 20px;font-family: &#39;Microsoft YaHei&#39;\">平台用户协议</span></strong></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">欢迎访问</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">平台，为明确您（以下简称为</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">用户</span><span style=\"font-family: Helvetica\">”</span><span style=\"font-family: 宋体\">）的权利义务，保护用户的合法权益，特制定本协议。申请使用本公司提供的</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">平台（以下简称为平台</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">）服务，请用户仔细阅读以下全部内容<strong>（特别是粗体下划线标注的内容）</strong>。如用户不同意本服务条款任意内容，请勿注册或使用平台服务。如用户通过进入注册程序并勾选</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">我同意平台服务协议</span><span style=\"font-family: Helvetica\">”</span><span style=\"font-family: 宋体\">，即表示用户与本公司已达成协议，自愿接受本服务条款的所有内容。此后，用户不得以未阅读本服务条款内容作任何形式的抗辩。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">鉴于：平台以</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">众筹</span><span style=\"font-family: Helvetica\">”</span><span style=\"font-family: 宋体\">模式为各类商品的销售提供网络空间。在本平台，商品被平分成若干等分，用户可以使用</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币支持一份或多份，当等份全部售完后，由系统根据平台规则计算出最终获得商品或服务的用户，其他用户则可获得相应的</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">宝石</span><span style=\"font-family: Helvetica\">”</span><span style=\"font-family: 宋体\">。</span></p><p style=\"margin-top:20px;text-align:left\"><strong><span style=\"font-family: 宋体\">一、用户使用平台服务的前提条件</span></strong></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">、用户拥有本公司认可的帐号，包括但不限于：</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">）自由行走网络科技（北京）有限邮箱帐号，用户通过自由行走网络科技（北京）有限邮箱帐号使用平台服务的，本服务协议是《自由行走网络科技（北京）有限邮箱帐号服务条款》的补充条款，与《自由行走网络科技（北京）有限邮箱帐号服务条款》具有同等法律效力。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">）第三方帐号，用户可使用</span><span style=\"font-family: Helvetica\">QQ</span><span style=\"font-family: 宋体\">帐号、微信帐号、微博帐号等其他本公司认可的帐号在同意本服务条款后使用平台服务。</span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">、用户在使用平台服务时须具备相应的权利能力和行为能力，能够独立承担法律责任，如果用户在</span><span style=\"font-family: Helvetica\">18</span><span style=\"font-family: 宋体\">周岁以下，必须在父母或监护人的监护参与下才能使用本站。</span></p><p style=\"margin-top:20px;text-align:left\"><strong><span style=\"font-family: 宋体\">二、用户管理</span></strong></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">、用户</span><span style=\"font-family: Helvetica\">ID</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">用户首次登录平台时，平台会为每位用户生成一个帐户</span><span style=\"font-family: Helvetica\">ID</span><span style=\"font-family: 宋体\">，作为其使用平台服务的唯一身份标识，用户需要对其帐户项下发生的所有行为负责。</span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">、用户资料完善</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">用户应当在使用平台服务时完善个人资料，用户资料包括但不限于个人手机号码、收货地址、帐号昵称、头像、密码、注册或更新自由行走网络科技（北京）有限邮箱帐号时输入的所有信息。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">用户在完善个人资料时承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性等七条底线，不得在资料中出现违法和不良信息，且用户保证其在完善个人资料和使用帐号时，不得有以下情形：</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">）违反宪法或法律法规规定的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">）损害国家荣誉和利益的，损害公共利益的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">4</span><span style=\"font-family: 宋体\">）煽动民族仇恨、民族歧视，破坏民族团结的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">5</span><span style=\"font-family: 宋体\">）破坏国家宗教政策，宣扬邪教和封建迷信的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">6</span><span style=\"font-family: 宋体\">）散布谣言，扰乱社会秩序，破坏社会稳定的</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">7</span><span style=\"font-family: 宋体\">）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">8</span><span style=\"font-family: 宋体\">）侮辱或者诽谤他人，侵害他人合法权益的；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">9</span><span style=\"font-family: 宋体\">）含有法律、行政法规禁止的其他内容的。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">若用户提供给本公司的资料不准确，不真实，含有违法或不良信息的，本公司有权不予完善，并保留终止用户使用平台服务的权利。若用户以虚假信息骗取帐号</span><span style=\"font-family: Helvetica\">ID</span><span style=\"font-family: 宋体\">或帐号头像、个人简介等注册资料存在违法和不良信息的，本公司有权采取通知限期改正、暂停使用、注销登记等措施。对于冒用关联机构或社会名人注册帐号名称的，本公司有权注销该帐号，并向政府主管部门进行报告。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">根据相关法律、法规规定以及考虑到平台服务的重要性，用户同意：</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">）在完善资料时提交个人有效身份信息进行实名认证；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">）提供及时、详尽及准确的用户资料；</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">）不断更新用户资料，符合及时、详尽准确的要求，对完善个人资料时填写的身份证件信息不能更新。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">4</span><span style=\"font-family: 宋体\">）<strong><span style=\"text-decoration:underline;\">用户有证明该帐号为本人所有的义务，需能提供自由行走网络科技（北京）有限邮箱注册资料或第三方平台注册资料以证明该帐号为本人所有，否则本公司有权暂缓向用户交付其所获得的商品。</span></strong></span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">、</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币及宝石</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">）<strong><span style=\"text-decoration:underline;\">用户获得</span></strong></span><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币并使用后可根据宝石获得规则获取相应的宝石。</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币的有效期自获得之日起算</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">360</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">天，有效期不可中断或延期，有效期届满后，用户帐户中有效期届满的</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币将被清空，且不可恢复。宝石自获得之日起生效，使用期限将在宝石规则中规定，详见平台页面提示。</span></span></strong></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币必须通过本公司提供或认可的平台获得，从非本公司提供或认可的平台所获得的</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币将被认定为来源不符合本服务协议，本公司有权拒绝从非本公司提供或认可的平台所获得的</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币在平台中使用。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">）</span><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币及宝石不能在平台之外使用或者转移给其他用户。</span></span></strong></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">4</span><span style=\"font-family: 宋体\">、用户应当保证在使用平台服务的过程中遵守诚实信用原则，不扰乱平台的正常秩序，<strong><span style=\"text-decoration:underline;\">不得通过使用他人帐户、一人注册多个帐户、使用程序自动处理等非法方式损害他人或本公司的利益。</span></strong></span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">5</span><span style=\"font-family: 宋体\">、若用户存在任何违法或违反本服务协议约定的行为，本公司有权视用户的违法或违规情况适用以下一项或多项处罚措施：</span></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">1</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）责令用户改正违法或违规行为；</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">2</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）中止、终止部分或全部服务；</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">3</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）取消用户</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">订单并取消商品发放（若用户已获得商品），</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">且用户已获得的</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币不予退回；</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">4</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）冻结或注销用户帐号及其帐号中的</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币及宝石（如有）；</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">5</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）其他本公司认为合适在符合法律法规规定的情况下的处罚措施。</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">若用户的行为造成本公司及其关联公司损失的，用户还应承担赔偿责任。</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">6</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">、若用户发表侵犯他人权利或违反法律规定的言论，本公司有权停止传输并删除其言论、禁止该用户发言、注销用户帐号及其帐号中的</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">币（如有），同时，本公司保留根据国家法律法规、相关政策向有关机关报告的权利。</span></span></strong></p><p style=\"margin-top:20px;text-align:left\"><strong><span style=\"font-family: 宋体\">三、</span></strong><strong><span style=\"font-family: Helvetica\">OneShop</span></strong><strong><span style=\"font-family: 宋体\">众筹平台服务的规则</span></strong></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">、释义</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">1</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币：指用户在平台上购买商品的资金的呈现方式。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">号码：指用户使用</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币参与</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">服务时所获取的随机分配号码。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">）幸运号码：指与某件商品的全部</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">号码分配完毕后，</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">根据</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">规则（详见</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">官方页面）计算出的一个号码。持有该幸运号码的用户可直接获得该商品。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">4</span><span style=\"font-family: 宋体\">）宝石：指用户参与平台活动后，其获得的</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">号码中未包含幸运号码的情况下，可获取的相应回报。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">5</span><span style=\"font-family: 宋体\">）全价购买：指用户以固定价格直接获得平台商品的形式。</span></p><p style=\"text-align:left\"><span style=\"font-family: 宋体\">（</span><span style=\"font-family: Helvetica\">6</span><span style=\"font-family: 宋体\">）</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">：指用户通过平台获得</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币，然后凭</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币参与平台活动，并在使用</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币后根据宝石获得规则获取相应宝石的形式。</span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">2</span><span style=\"font-family: 宋体\">、本公司承诺遵循公平、公正、公开的原则运营平台，确保所有用户在平台中享受同等的权利与义务，</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">结果向所有用户公示。</span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">3</span><span style=\"font-family: 宋体\">、用户知悉，除本协议另有约定外，无论是否获得商品，用户已用于参与平台活动的</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">币不能退回；其完全了解参与平台活动存在的风险，本公司不保证用户参与</span><span style=\"font-family: Helvetica\">OneShop</span><span style=\"font-family: 宋体\">一定会获得商品，但用户参与后可根据宝石规则获得相应的宝石。宝石规则，详见</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">我的</span><span style=\"font-family: Helvetica\">OneShop”</span><span style=\"font-family: 宋体\">下的</span><span style=\"font-family: Helvetica\">“</span><span style=\"font-family: 宋体\">我的宝石</span><span style=\"font-family: Helvetica\">”</span><span style=\"font-family: 宋体\">栏目。</span></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">4</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">、用户通过参与平台活动获得商品后，应在</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">7</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">天内登录平台提交或确认收货地址，否则视为放弃该商品，用户因此行为造成的损失，本公司不承担任何责任。</span></span></strong><span style=\"font-family: 宋体\">商品由本公司或经本公司确认的第三方商家提供及发货。</span></p><p style=\"text-align:left\"><span style=\"font-family: Helvetica\">5</span><span style=\"font-family: 宋体\">、用户通过参与平台活动获得的商品，享受该商品生产厂家提供的三包服务，具体三包规定以该商品生产厂家公布的为准。</span></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">6</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">、如果下列情形发生，本公司有权取消用户</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">OneShop</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">订单：</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">1</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">）因不可抗力、平台系统发生故障或遭受第三方攻击，或发生其他本公司无法控制的情形；</span></span></strong></p><p style=\"text-align:left\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: 宋体\">（</span></span></strong><strong><span style=\"text-decoration:underline;\"><span style=\"font-family: Helvetica\">2