=\"color: rgb(128, 128, 128); font-family: &quot;Microsoft Yahei&quot;, verdana; font-size: 14px; text-indent: -23px; background-color: rgb(255, 255, 255);\">OneShop</span>有权不受理换货申请。</p><p><br/></p>', '0', '0', '1375862747'), ('10', '3', 'author', '长时间未收到商品', '', '', 'a:0:{}', '', '', '<p>	</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(128, 128, 128); font-family: &#39;Microsoft Yahei&#39;, verdana; font-size: 14px; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">1、确保收货地址、邮编、电话、Email、地址等各项信息的准确性；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(128, 128, 128); font-family: &#39;Microsoft Yahei&#39;, verdana; font-size: 14px; line-height: 26px; white-space: normal; background-color: rgb(255, 255, 255);\">2、配送过程中联系方式畅顺无阻，如果联络您的时间超过7天未得到回复，默认您已经放弃此商品。</p><p><br/></p>', '0', '0', '1375862760'), ('11', '2', 'author', '隐私声明', '', '', 'a:0:{}', 'OneShop', '', '<p>	</p><p><br/></p><p><br/></p><p><br/></p><h1 style=\" text-decoration: underline;\">隐私声明</h1><p><br/>本网站其中一项最重要的资产，就是客户能适当处理其信息的信赖和信任。客户及潜在客户期望我们准确维护其信息，保护信息免遭篡改和错误使用，失窃以及无未经客户授权泄露信息之虞。我们遵行适用的隐私相关法律和规章制度，以期为客户\n及潜在客户的个人资料提供安全保障，并确保员工遵守严格的安全及保密标准。</p><p><br/>本声明旨在您告知您我公司收集您个人资料的原因、资料可能的用途、可能获得您个人资料的第三方，有关您查阅、检查及修订您个人资料的方法，以及我们直接销\n售及使用Cookies（网络跟踪器）的政策。使用本网站即表示您接受本隐私声明中的惯例做法及政策。若您反对本声明中的任何惯例做法及政策，请不要使用本网站将个人资料提交给本网站。</p><p><br/>本网站仅提供一般资料。虽然我们已尽合理努力，确保本网站的资料准确，不保证资料绝对准确，亦概不为资料不准确或因任何错漏所产生的任何损失或损害而承担任何责任。如未得到事前准许，不得复制（作为个人用途例外）或转发本网站所载的任何资料。</p><p><br/>我们承认其负有有关收集、持有、处理或使用私人数据的责任。您提供个人资料，纯属自愿性质。您可选择不向我们提供所需的个人资料，但这样做会影响到我们为您提供服务的能力。我们不会通过本网站收集任何可识别您身份的资料，除非直至您购买我们的产品或服务，登记成为客户或基于申请职位而提供个人资料起为始。</p><p><br/>若您处于限制我们分发资料或使用有关社交媒体平台的司法管辖区内，则不应使用本网站及我们的社交媒体平台。若此规定适用于您，我们建议您自行了解及遵从有关限制，我们不因此而承担任何责任。</p><h1><br/>收集资料的方法</h1><p><br/>我们将会收集及储存您在本网站输入的资料，或通过其他渠道向我们提供的资料。我们亦会从附属公司、商业伙伴及其他独立第三方资料来源，获取与您有关并合法收集的个人或非个人资料。在您到访本网站时，我们亦收集与您所用电脑或其他装置有关的某些资料。</p><p><br/>若您在本网站，我们所提供的应用程序或另行通过社交媒体供应商使用任何社交媒体功能或平台，我们可能通过有关社交媒体供应商，按照其有关政策查阅及收集与\n您有关的资料。在使用社交媒体功能时，我们可能会查阅及收集您于您的社交媒体个人账户选择提供并列入在内的资料，有关资料包括（但不限于）您的姓名、性\n别、出生日期、电邮地址、地址、地点等。您在有关社交媒体供应商所作的隐私设定，可限制或阻止我们对有关资料的查阅。</p><h1><br/>收集您个人资料的原因及可能用途</h1><p><br/>收集个人资料可作以下用途：</p><ul class=\" list-paddingleft-2\"><li><p>处理、实施、执行和实行在本网站上所提供的表格中或您可能不时交予我们的任何其他文件项下的要求或交易；</p></li><li><p>设计全新或加强目前我们所提供的产品及服务；</p></li><li><p>与您保持联系，包括向您寄发有关您在我们公司任何账户或本隐私声明日后变动的通讯；</p></li><li><p>我们的相关监管机构的统计或精算研究之用；</p></li><li><p>供我们作资料匹配，内部业务及管理之用；</p></li><li><p>协助执行法例、警方或其他政府或监管机构调查，以及遵守适用法律及规例所施行的规定，或其他向政府或监管机构承诺之义务；</p></li><li><p>将我们网站的外观个人化，提供相关产品的建议，以及在本网站或通过其他渠道进行目标广告活动；</p></li><li><p>在收集之时所通知的其他用途；</p></li><li><p>与上述任何项目直接有关的其他用途。</p></li></ul><p><br/>若您提供个人资料予我们，即表示您接受，我们将可因所需期限留存资料以履行有关用途，而就该等用途而言，有关资料乃在遵守适用相关法律及规定的情况下\n收集。我们采用合理的保障措施，包括限制亲身查阅我们系统内的数据及在转移敏感数据时进行加密处理，以防止未经许可或意外的查阅、处理、删除、丢\n失或使用情况。若不再需要用作上述任何用途，将会采取合理步骤删除或销毁有关资料。</p><p><br/>有关我们使用您个人资料作宣传或市场推广用途的政策，请参阅「使用个人资料作直接促销用途」一节。</p><h1><br/>谁会取得您的个人资料？</h1><p><br/>个人资料将保密处理，仅在法律许可且就符合收集个人资料用途或直接相关用途而披露是必须时，方可向以下各方提供相关个人资料（有关我们分发您个人资料作宣传或市场推广用途的政策，请参阅「使用个人资料作直接促销用途」一节。）：</p><ul class=\" list-paddingleft-2\"><li><p>获授权担任产品及服务有关的任何人士；</p></li><li><p>就营运以及向您提供服务相关而提供管理、数据处理、电讯、电脑、付款、收债或证券结算、技术外判、电话中心服务、邮寄及印刷服务的任何代理、承包商或第三方服务供应商（无论在内或外）；</p></li><li><p>任何代理、承包商或第三方服务供应商（无论在内或外），包括协助提供服务的公司，例如再保险公司、投资管理公司、索赔调查公司、业界协会或联盟；</p></li><li><p>协助收集您资料或与您联系的其他公司，例如研究调查公司及信贷评级机构，藉以加强我们向您所提供的服务；及</p></li><li><p>政府或监管机构：</p></li><p>(a)根据在该司法管辖区适用于该友邦保险公司的法律及监管义务而必须对其披露的任何人士；</p><p>(b)依据该友邦保险公司与相关政府、监管机构或其他人士协议必须对其披露的任何人士。</p></ul><p><br/>就我们因在提供保险服务而收集的个人资料，该等个人资料将只会提供予上述人士作提供相关保险服务的用途。</p><p><br/>我们可不时购买业务或出售我们一项或多项业务（或其部分），而在法律许可的情况下，您的个人资料可作为该买卖或建议买卖的一部分予以转让或披露。若我们购买一项业务，就该业务所获得的个人资料将在其可行及允许的情况下根据本隐私声明处理。</p><p><br/><strong>若法律法规许可，可将您的个人资料提供予上述任何一方，有关各方可位于境内或境外。</strong>您的资料，将可转移往若您向我们提供个人资料，或使用我们的服务或本网站或应用程式，即表示您同意将有关资料从您的司法管辖区转移至我们在其之外的设施，或如上\n文所载转移至我们与其分享有关资料的第三方。</p><h1><br/>查阅个人资料的权利</h1><p><br/>您有权：</p><ul class=\" list-paddingleft-2\"><li><p>核实我们是否持有您的个人资料，并查阅任何该等资料；</p></li><li><p>要求我们更正任何有关您的错误个人资料；</p></li><li><p>及就有关个人资料的政策及惯例作出查询。</p></li></ul><p><br/></p><h1>使用个人资料作直接销售用途</h1><p><br/>除上述用途外，在法律许可的情况下，我们可使用您的姓名和联络资料作宣传或市场推广用途，包括向您寄发宣传资料及就以下产品、服务、建议、目的作直接\n销售及后续的保险服务然而，就我们因在提供保险服务而收集的个人资料，该等个人资料将只会用作宣传或推广直接与保险相关的产品或服务。</p><p><br/>鉴于直接促销的用途，在法律许可的情况下，除因我们在提供保险服务所收集的个人资料外，我们或会将您的个人资料提供予任何上述描述的促销标的类别、电\n话中心、市场推广或研究服务的提供商（无论在内或外），从而他们可就其所提供的产品及服务向您寄发宣传资料及进行直接促销，有关资料可透过邮寄、\n电邮或其他方式送达予您。在法律许可的情况下，我们或会将您的个人资料提供予任何以上描述的促销标的类别的提供商（无论在内或外）而得益。</p><p><br/>就本节用途使用或向本部分受让方提供您的个人资料前，我们可能受法律所规定要取得您的书面同意，且在该等情况下，仅会在取得有关书面同意后方就任何宣传或市场推广用途使用或提供您的个人资料。</p><p><br/>我们会使用及提供作上述直接促销用途的个人资料为您的姓名和相关联络资料；然而，我们可管有更多的个人资料。</p><p><br/>如要求您同意，而您给予该等同意，您可于其后撤回对我们使用并向第三者提供您的个人资料作直接促销用途的同意；此后，我们须停止使用或提供该等资料作直接促销之用。</p><p><br/>如您已给予同意但又欲将其撤回，请以书面或电邮方式通知我们，书面通知可邮寄至「查阅个人资料的权利」一节所载地址，而电邮可发送至privacy.compliance@aia.com。任何有关请求应清楚列明该要求相关的个人资料详情。</p><h1><br/>使用Cookies</h1><p><br/>Cookies乃网络伺服器放置在您的电脑或其他装置的独一无二标识符，其载有资料，可在其后由向您发Cookies的伺服器解读。友邦保险亦可在其维持\n的网站使用Cookies。所收集的资料（包括（但不限于）您的IP位址（及网域名称）、浏览器软件、浏览器的类别及配置，语言设定、地理位置、作业系\n统、转介网站、所浏览网页及内容及到访期间）将用作编製访客怎样到达及浏览我们网站的总体统计数字，协助我们瞭解如何改善您到访我们网站的体验。有关资料\n将会以不具名方式收集，并不能识别您的身份，除非您以会员身份登入，则作别论。我们只会使用有关资料作增进及优化网站。Cookies亦让我们的网站就您\n及您的喜好留下记录，让我们可按您的需要，为您度身设定网站。广告Cookies亦可让我们的网站提供与您尽可能有关的广告，如为您甄选以兴趣为主的广\n告，或阻止不断向您展现同一广告等。</p><p><br/>大部份网页浏览器在最初已设定为可接受Cookies。若您不愿接收Cookies，可在您的浏览器设定中关闭有关功能。然而，如关闭功能，您将不能尽享我们网站的优点，而若干功能可能不可以正常运作。</p><h1><br/>外部链接</h1><p><br/>若本网站任何部分载有连接其他网站的链接，有关网站可能并非根据本隐私声明运作隐私，藉以瞭解其收集、使用、转移及披露个人资料的政策。</p><h1><br/>本隐私声明的修订</h1><p><br/>我们保留权利可随时且在无须通知的情况下仅凭知会您有关修改、更新或修订，而增添、修改、更新或修订本隐私声明。倘我们决定修改我们的个人资料政策，\n我们将于我们的网站知会您有关修改，从而让您能得悉我们所收集的资料、我们如何使用该资料及在何种情况下会披露该资料。任何有关修改、更新或修订将在刊登\n后即时生效。</p><h1><br/>其他资料</h1><p><br/>如您对本隐私声明的任何部分有任何疑问或如欲知悉有关我们的资料保密惯例的更多资料，请随时通过上述联络途径与我们联络。</p>', '71', '1', '1466572560'), ('12', '4', 'author', '官方微信', '', '', 'a:0:{}', '', '', '<p>	</p><p style=\"text-align: center;\"><img src=\"http://zyxztd.com/statics/uploads/shopimg/20160607/49997167278130.jpg\" title=\"code.jpg\"/></p><p style=\"text-align: center;\"><span style=\"color: rgb(255, 0,